.data-labels {
  font-size: 12px;
  text-anchor: middle;
  font-family: helvetica, arial, sans-serif;
  pointer-events: none;
}
.timeline-component {
  cursor: default;
}
.timeline-component .timeline {
  font-family: helvetica, arial, sans-serif;
  -webkit-tap-highlight-color: transparent;
  cursor: default;
  overflow-y: hidden;
}
.timeline-component .timeline .label,
.timeline-component .timeline .mainArea .label,
.timeline-component .timeline .upperTextCell,
.timeline-component .timeline .lowerTextCell {
  text-anchor: middle;
}
.timeline-component .timeline .mainArea .above {
  transform: translate(0, -10px);
}
.timeline-component .timeline .mainArea .inside {
  transform: translate(0, 25px);
}
.timeline-component .timeline .mainArea .below {
  transform: translate(0, 60px);
}
.timeline-component .timeline .cellRect {
  stroke: #333444;
}
.timeline-component .timeline .selectionCursor {
  fill: gray;
}
.timeline-component .timeline .selectionRangeContainer {
  text-anchor: start;
}
.timeline-component .timeline .periodSlicerSelectionRect,
.timeline-component .timeline .timelineVertLine,
.timeline-component .timeline .cellRect {
  cursor: pointer;
}
.timeline-component .timeline .selectionCursor {
  cursor: ew-resize;
}
.timeline-component .timelineSlicer {
  fill: #000000;
  cursor: pointer;
}
.timeline-component .timelineSlicer .periodSlicerGranularities,
.timeline-component .timelineSlicer .periodSlicerSelection {
  font-size: 10px;
  text-anchor: middle;
}
.timeline-component .timelineSlicer .periodSlicerSelectionRect {
  fill: transparent;
}
.timeline-component .timelineSlicer .periodSlicerRect {
  pointer-events: none;
}
.timeline-component .rangeTextArea.left {
  transform: translate(calc(0% + 20px), 0);
}
.timeline-component .rangeTextArea.right {
  transform: translate(calc(100% - 20px), 0);
}
.timeline-component .rangeTextArea.center {
  transform: translate(50%, 0);
}
.timeline-component .timelineWrapper {
  overflow: auto;
  width: 100%;
}
